// Button.tsx
import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom
import styles from './Button.module.css';

// Assuming you are using TypeScript, let's define props type for clarity and type checking
type ButtonProps = {
    path: string;
    children: React.ReactNode;
};

const Button = ({ path, children }: ButtonProps) => {
    return (
        // Use the Link component instead of the button element
        <Link to={path} className={styles.button} role="button">
            {children}
        </Link>
    );
};

export default Button;
